  `post_grad` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`educ_id`),
  UNIQUE KEY `educ_id_UNIQUE` (`educ_id`),
  UNIQUE KEY `user_id_UNIQUE` (`user_id`),
